INSERT INTO `sorteomagno` (`id`, `imagen`, `archivoexcel`, `archivopdf`, `texto`) VALUES
(1, '1576791105banners_listas-Magno.png', '1576868392_UPMAGNO85C.xlsx', '1576875612_PDF-ListaGanadoresMagno.pdf', 'La entrega de premios se llevará a cabo a partir del 26 de diciembre de 2019, de lunes a viernes de 9:00 a 18:00 hrs y sábados de 9:00 a 13:00 hrs. en nuestras oficinas, previa identificación del titular (Credencial INE o Pasaporte Mexicano) y el boleto correspondiente.\r\n\r\nLos premios no reclamados dentro de los 20 días hábiles siguientes a la celebración del sorteo, se entregarán a la Secretaría de Gobernación, para sus Instituciones Asistenciales o de Beneficiencia.\r\n\r\nSorteo celebrado a las 15:00 hrs. del día 18 de diciembre de 2019, en el Edificio de Rectoría de la Universidad Autónoma de Baja California, en Mexicali, B.C. ante la presencia de la C. Inspectora de la Secretaría de Gobernación Karla Leticia Ruiz Corrales.\r\n\r\nPara quejas derivadas de este sorteo, acudir a la Dirección General de Juegos y Sorteos de la Secretaría de Gobernación. Teléfono (55) 5209-8800. \r\nPermiso SEGOB: 20190216PS04'),
(2, '1571168904banners_listas.png', '1571431942_TemplateWEBS85C.xlsx', '1571440380_PDF-ListaGanadoresColaboradores1.pdf', 'La entrega de premios se llevará a cabo a partir del 22 de octubre de 2019, de lunes a viernes de 9:00 a 18:00 hrs en nuestras oficinas, previa identificación del titular (Credencial INE o Pasaporte Mexicano) y el boleto correspondiente.\r\n\r\nSorteo celebrado a las 16:00 hrs. del día 17 de octubre de 2019, en el Centro Comunitario de la UABC, ubicado en Calzada Universidad #14418, Mesa de Otay en Tijuana, B.C. ante la presencia de la C. Inspectora de la Secretaría de Gobernación, Claudia Soledad Íñiguez Soto. Para quejas derivadas de este sorteo, acudir a la Dirección General de Juegos y Sorteos de la Secretaría de Gobernación. Teléfono (55) 5209-8800.\r\nPermiso SEGOB: 20190219PS05.'),
(3, '1574453558banners_listas-2doCol.png', '1574454553_TemplateWEBS85AA.xlsx', '1574473917_PDF-ListaGanadoresColaboradores2 (1).pdf', 'La entrega de premios se llevará a cabo a partir del 26 de noviembre de 2019, de lunes a viernes de 9:00 a 18:00 hrs en nuestras oficinas, previa identificación del titular (Credencial INE o Pasaporte Mexicano) y el boleto correspondiente.\r\n\r\nSorteo celebrado a las 16:00 hrs. del día 21 de noviembre de 2019, en el Centro Comunitario de la Vicerrenctoría UABC, ubicado en Blvd. Benito Juárez s/n Col. Ex Ejido Coahuila, en Mexicali, B.C. ante la presencia de la C. Inspectora de la Secretaría de Gobernación, Karla Leticia Ruiz Corrales. Para quejas derivadas de este sorteo, acudir a la Dirección General de Juegos y Sorteos de la Secretaría de Gobernación. Teléfono (55) 5209-8800.\r\nPermiso SEGOB: 20190219PS05'),
(4, '1576791965banners_listas-3erCol.png', '1576813532_TemplateWEBS85B.xlsx', '1576864389_PDF-ListaGanadoresColaboradores3.pdf', 'La entrega de premios se llevará a cabo a partir del 26 de diciembre de 2019, de lunes a viernes de 9:00 a 18:00 hrs en nuestras oficinas, previa identificación del titular (Credencial INE o Pasaporte Mexicano) y el boleto correspondiente.\r\n\r\nSorteo celebrado a las 16:00 hrs. del día 18 de diciembre de 2019, en el Edificio de Rectoría de la Universidad Autónoma de Baja California, en Mexicali, B.C. ante la presencia de la C. Inspectora de la Secretaría de Gobernación, Karla Leticia Ruiz Corrales. Para quejas derivadas de este sorteo, acudir a la Dirección General de Juegos y Sorteos de la Secretaría de Gobernación. Teléfono (55) 5209-8800.\r\nPermiso SEGOB: 20190219PS05'),
